import React, { useState, useContext, useEffect } from "react";
import { ThemeContext } from "../../context/Theme";
import LineChart from "../../components/ui/LineChart";

const SalesAndRevenueChart = () => {
  const chartData = {
    labels: [
      "January",
      "February",
      "March",
      "April",
      "May",
      "June",
      "July",
      "August",
      "September",
      "October",
      "November",
      "December",
    ],
    datasets: [
      {
        label: "Sales",
        data: [0, 20, 30, 40, 50, 60, 30, 40, 20, 50, 55, 15],
        borderColor: "rgba(54, 162, 235, 1)",
        backgroundColor: "rgba(54, 162, 235, 0.2)",
        borderWidth: 2,
        tension: 0.4,
        pointBackgroundColor: "rgba(54, 162, 235, 1)",
      },
      {
        label: "Revenue",
        data: [10, 25, 35, 45, 55, 65, 35, 45, 25, 55, 60, 20],
        borderColor: "rgba(255, 99, 132, 1)",
        backgroundColor: "rgba(255, 99, 132, 0.2)",
        borderWidth: 2,
        tension: 0.4,
        pointBackgroundColor: "rgba(255, 99, 132, 1)",
      },
    ],
  };

  return (
    <div className="w-full p-5 rounded-lg shadow-md bg-white">
      <h2 className="text-2xl font-bold mb-4">Sales and Revenue Chart</h2>
      <LineChart title_text="Monthly Sales and Revenue" data={chartData} />
    </div>
  );
};

export default SalesAndRevenueChart;
